/* ========================= */ /* 3. Helper functions and staging tables */ /* ========================= */ /* Normalize heterogeneous trades into signed quantity and price */ CREATE OR REPLACE FUNCTION stg_investments.normalize_trade(p_side TEXT, p_quantity DECIMAL(20, 4), p_price DECIMAL(18, 6), p_gross_amount DECIMAL(18, 6)) RETURNS TABLE (norm_qty DECIMAL(20, 4), norm_price DECIMAL(18, 6)) LANGUAGE plpgsql AS $$
BEGIN
    IF p_price IS NOT NULL THEN
        -- Use explicit price
        norm_price := p_price;
    ELSIF p_gross_amount IS NOT NULL AND p_quantity IS NOT NULL AND p_quantity <> 0 THEN
        norm_price := p_gross_amount / p_quantity;
    ELSE
        norm_price := NULL;
    END IF;

    -- Apply sign based on side
    IF p_side IN ('SELL','S') THEN
        norm_qty := -1 * p_quantity;
    ELSE
        norm_qty := p_quantity;
    END IF;

    RETURN NEXT;
END;
$$

/* FX conversion helper */ CREATE OR REPLACE FUNCTION stg_investments.to_usd(p_ccy TEXT, p_trade_dt DATE, p_amount DECIMAL(30, 10)) RETURNS DECIMAL(30, 10) LANGUAGE plpgsql AS $$
DECLARE
    v_rate NUMERIC(18,8);
BEGIN
    SELECT usd_rate INTO v_rate
    FROM raw_market.fx_rates
    WHERE as_of_date = p_trade_dt
      AND ccy = p_ccy;

    IF NOT FOUND OR v_rate IS NULL THEN
        RETURN NULL;
    END IF;

    RETURN p_amount * v_rate;
END;
$$

CREATE OR REPLACE FUNCTION stg_investments.trg_position_intraday_audit_fn() RETURNS TRIGGER LANGUAGE plpgsql AS $$
DECLARE
    v_notional_ccy NUMERIC(30,10);
    v_notional_usd NUMERIC(30,10);
BEGIN
    v_notional_ccy := NEW.quantity * NEW.price_ccy;
    v_notional_usd := stg_investments.to_usd(NEW.currency, NEW.trade_date, v_notional_ccy);

    INSERT INTO stg_investments.position_intraday_audit (
        position_id, trade_ts, account_code, instrument_isin,
        quantity, price_ccy, notional_ccy, notional_usd,
        currency
    )
    VALUES (
        NEW.position_id, NEW.trade_ts, NEW.account_code, NEW.instrument_isin,
        NEW.quantity, NEW.price_ccy, v_notional_ccy, v_notional_usd,
        NEW.currency
    );

    RETURN NEW;
END;
$$
